import React, { Component } from 'react';
import AlumnoService from '../services/AlumnoService';

class AlumnoComponent extends Component {
    constructor() {
        super();

        this.state = {
            rut: '',
            apellidos: '',
            nombres: '',
            fnacimiento: '',
            tipo_colegio: '',
            nom_colegio: '',
            ano_egres: 0,
            tipo_pago: '',
            arancel: 0
        };

        this.setRut = this.setRut.bind(this);
        this.setApellidos = this.setApellidos.bind(this);
        this.setNombres = this.setNombres.bind(this);
        this.setFnacimiento = this.setFnacimiento.bind(this);
        this.setNom_colegio = this.setNom_colegio.bind(this);
        this.setTipo_colegio = this.setTipo_colegio.bind(this);
        this.setAno_egres = this.setAno_egres.bind(this);
        this.setTipo_pago = this.setTipo_pago.bind(this);
        this.saveAlumno = this.saveAlumno.bind(this);
    }

    saveAlumno = (e) => {
        e.preventDefault();
        let alumno = {
            rut: this.state.rut,
            apellidos: this.state.apellidos,
            nombres: this.state.nombres,
            fecha_nacimiento: this.state.fnacimiento,
            tipo_colegio: this.state.tipo_colegio,
            nombre_colegio: this.state.nom_colegio,
            ano_egreso: this.state.ano_egres,
            tipo_pago: this.state.tipo_pago,
            arancel: this.state.arancel
        };

        AlumnoService.createAlumno(alumno).then(res => {
            this.history.push('/alumnos');
        });
    }

    setRut(event) {
        this.setState({ rut: event.target.value });
    }

    setApellidos(event) {
        this.setState({ apellidos: event.target.value });
    }

    setNombres(event) {
        this.setState({ nombres: event.target.value });
    }

    setFnacimiento(event) {
        this.setState({ fnacimiento: event.target.value });
    }

    setNom_colegio(event) {
        this.setState({ nom_colegio: event.target.value });
    }

    setTipo_colegio(event) {
        this.setState({ tipo_colegio: event.target.value });
    }

    setAno_egres(event) {
        this.setState({ ano_egres: event.target.value });
    }

    setTipo_pago(event) {
        this.setState({ tipo_pago: event.target.value });
    }

    render() {
        return (
            <div>
                <div className="container">
                    <div className="row">
                        <div className="card col-md-4 offset-md-3 offset-md-3 bg-dark text-white rounded mx-auto">
                            <h3 className="text-center">Crear Alumno</h3>
                            <div className="card-body">
                                <form>
                                    <div className="form-group mb-3">
                                        <label className="text-white"> Rut: </label>
                                        <input placeholder="Rut: 12345678-9" name="rut" className="form-control"
                                            type='text' value={this.state.rut} onChange={this.setRut} />
                                    </div>
                                    <div className="form-group mb-3">
                                        <label className="text-white"> Apellidos: </label>
                                        <input placeholder="Ingrese sus Apellidos" name="apellidos" className="form-control"
                                            type='text' value={this.state.apellidos} onChange={this.setApellidos} />
                                    </div>
                                    <div className="form-group mb-3">
                                        <label className="text-white"> Nombres: </label>
                                        <input placeholder="Ingrese sus Nombres" name="nombres" className="form-control"
                                            type='text' value={this.state.nombres} onChange={this.setNombres} />
                                    </div>
                                    <div className="form-group mb-3">
                                        <label className="text-white"> Fecha de Nacimiento: </label>
                                        <input placeholder="Ingrese la fecha de nacimiento" name="fnacimiento" className="form-control"
                                            type='date' value={this.state.fnacimiento} onChange={this.setFnacimiento} />
                                    </div>
                                    <div className="form-group mb-3">
                                        <label className="text-white"> Nombre del Colegio: </label>
                                        <input placeholder="Nombre del Colegio de Egreso" name="ncolegio" className="form-control"
                                            type='text' value={this.state.nom_colegio} onChange={this.setNom_colegio} />
                                    </div>
                                    <div className="form-group mb-3">
                                        <label className="text-white"> Tipo de Colegio: </label>
                                        <select name="tcolegio" value={this.state.tipo_colegio} onChange={this.setTipo_colegio} className="form-control">
                                            <option value="Municipal">Municipal</option>
                                            <option value="Subvencionado">Subvencionado</option>
                                            <option value="Privado">Privado</option>
                                        </select>
                                    </div>
                                    <div className="form-group mb-3">
                                        <label className="text-white"> A침o(s) desde que egres칩: </label>
                                        <input placeholder="A침os desde que egres칩" name="aegreso" className="form-control"
                                            type='number' value={this.state.ano_egres} onChange={this.setAno_egres} />
                                    </div>
                                    <div className="form-group mb-3">
                                        <label className="text-white">Tipo de Pago:</label>
                                        <select name="tpago" value={this.state.tipo_pago} onChange={this.setTipo_pago}
                                            className="form-control">
                                            <option value="Contado">Contado</option>
                                            <option value="Cuotas">Cuotas</option>
                                        </select>
                                    </div>
                                    <button className="btn btn-primary" onClick={this.saveAlumno}>Guardar</button>
                                </form>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}
export default AlumnoComponent;
